* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/

import JSONdata from "../data.json";
import React, { Component } from 'react';
import GoogleMapReact from 'google-map-react';

const AnyReactComponent = ({ text }) => <div>{text}</div>;
var US_location=JSONdata.US_location;

class Maps extends Component {
  static defaultProps = {
    center: {
      lat: 37.090,
      lng: -95.712
    },
    zoom: 4.75
  };

  render() {
    var circles=US_location.map(location=>{
      return (
        <Circle 
          defaultCenter={{
            lat: parseFloat(location.center.lat),
            lng: parseFloat(location.center.lng)
          }}
          radius={location.Confirmed}
          options={{ fillColor: 'red', strokeColor: 'red' }}
        />
      )
    })
    return (
      // Important! Always set the container height explicitly
      <div style={{ height: '100vh', width: '100%' }}>
        <GoogleMapReact
          bootstrapURLKeys={{key:"AIzaSyCD66iXvfQg8hp7BPTdsXxIgG1S_6EK998"}}
          defaultCenter={this.props.center}
          defaultZoom={this.props.zoom}
        >

          <AnyReactComponent
            lat={59.955413}
            lng={30.337844}
            text="My Marker"
          />
        </GoogleMapReact>
      </div>
    );
  }
}

export default Maps;
